function generarPDF()
{
  var img1 = 'data:image/png;base64,';
  var img2 = 'data:image/png;base64,';
  var img3='data:image/png;base64,';
  var doc= new jsPDF();
  doc.addImage(img1, 'JPEG', 15, 2, 45, 13);
  doc.addImage(img3, 'JPEG',95,2,25,13);
  doc.addImage(img2, 'JPEG', 154, 6, 43, 10);
  doc.text('Informe de control', 85, 30);
  doc.autoTable(
    {
      html: "#tbl",

      startY: 70 - 30,

      styles: {
        lineWidth: 0.3,
        lineColor: [0, 0, 0],
        halign: 'center',
        //cellPadding: 0.2,
        margin: 40,
        fontSize: 7,
        theme: 'plain'
      }
    });
  let finalY = doc.previousAutoTable.finalY; //this gives you the value of the end-y-axis-position of the previous autotable.
  //doc.text("Text to be shown relative to the table", 10, finalY +5 );

  //Se imprime el pdf
  doc.save("ReporteControl.pdf");
}


function generarEXCEL()
{
  $("#tbl").table2excel({
    exclude: "button",
    include: "input",
    sheetName: "Reporte ",
    name: "Rep",
    filename: "ReporteControl" + ".xls", // do include extension
    preserveColors: true // set to true if you want background colors and font colors preserved
  });
}





function ActualizarLista(parametros, pagina, fechai) {
  //$('#listaProductos').html('<div class="text-center"><img src="imagenes/loading.gif"></div>');
  parametros['funcion'] = 1;
  parametros['pagina'] = pagina;
  parametros['fechai'] = fechai;
  //parametros['fechaf'] = fechaf;

  $.post("../controllers/historicoBack.php", parametros, function (data) {

    if (data != false) {

      $('#tbldatos').html(data);
    }
    else {

      $('#tbldatos').html("<tr><td>Sin datos registrados</td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td></tr>")

    }
  });
}
